import React from "react"
import { useHistory } from "react-router-domnpm";
export default function Form() {
    const history = useHistory();
    const routeChange = () =>{ 
      let path = `./MainContent`; 
      history.push(path);
    }
    return (
        <div className="main">
            <input type="checkbox" className="chk" aria-hidden="true"></input>
            <form className="signup">
                <label for="chk" aria-hidden="true">Авторизация</label>
                <input type="text" name="txt" placeholder="Username" required="" />
                <input type="password" name="pswd" placeholder="Password" required="" />
                <input type="Authentication" name="Authentication" placeholder="Authentication" required="" />
                <button  onClick={routeChange}>Вход</button>
            </form>
        </div>
    )   
}
